CREATE  PROCEDURE `listaGralProd`(IN `institucion` VARCHAR(100))
SELECT

	IFNULL( producto.codBarra, 'NULO' ),

	IFNULL(producto.nombre,'NULO'),

	IFNULL(producto.marca,'NULO'),

	IFNULL(entradaProducto.fecha_caducidad, 'NULO'),

	IFNULL(entradaProducto.fecha_mov, 'NULO'),

	IFNULL(entradaProducto.cant_entrante, 0),

	IFNULL(entradaProducto.estado_producto, 'NULO'),

	IFNULL(salidaProducto.fecha_mov,'NULO'),

	IFNULL(salidaProducto.cant_saliente, 0),

	IFNULL(salidaProducto.no_lotes, 0),

	IFNULL(salidaProducto.codigo_lotes, 'NULO'),

	IFNULL(salidaProducto.estado_prod, 'NULO'),

	IFNULL(salidaProducto.orden_produccion, 'NULO'),

	IFNULL(salidaProducto.autorizacion, 'NULO'),

	IFNULL(empresa.empresa,'NULO'),

	IFNULL(salidaProducto.cant_ante, 0),

	IFNULL(salidaProducto.cant_posterior, 0) 

FROM

	entradaProducto

	LEFT OUTER JOIN producto ON entradaProducto.id_producto = producto.id

	LEFT OUTER JOIN salidaProducto ON producto.id = salidaProducto.id_producto

	LEFT OUTER JOIN empresa ON salidaProducto.id_cliente = empresa.id

    LEFT OUTER JOIN usuario ON entradaProducto.id_usuario = usuario.ID AND usuario.Institucion = institucion ;;
DELIMITER ;
